et by either (1) demonstrating past persecution on account of a protected ground and thus, creating a presumption of a well-founded fear of persecution, or (2) demonstrating a well-founded fear of persecution on account of a protected ground. 8 C.F.R. ÃÂ§ 1208.13(b)). A protected ground must be at least one central reason motivating the persecution. 8 U.S.C. ÃÂ§ 1158(b)(1)(A); INA ÃÂ§ 208(b)(1)(A).\n\nIn this case, ÃÂ«Client_First_NameÃÂ» meets the definition of a refugee required for asylum. First, ÃÂ«Client_First_NameÃÂ» has a well-founded fear of persecution in ÃÂ«Home_CountryÃÂ» on account of ÃÂ«PronounÃÂ» membership in a particular social group of ÃÂ«Particular_Social_GroupÃÂ». ÃÂ«Client_First_NameÃÂ»Ã¢â¬â¢s membership in this particular social group is the central reason for ÃÂ«PronounÃÂ» fear of future persecution and the ÃÂ«Home_CountryÃÂ» government is unable to protect ÃÂ«PronounÃÂ» from being persecuted or killed on account of being ÃÂ«Sexual_OrientationÃÂ».\n\n ÃÂ«Client_First_NameÃÂ» timely filed ÃÂ«PronounÃÂ» application for asylum \n\nIn addition to substantive eligibility, an asylum applicant must show by clear and convincing evidence that ÃÂ«PronounÃÂ» timely filed ÃÂ«PronounÃÂ» asylum application within one year of ÃÂ«PronounÃÂ» last arrival in the United States 8 U.S.C. ÃÂ§ 1158(a)(2)(B); INA ÃÂ§ 208(a)(2)(B). Here, ÃÂ«Client_First_NameÃÂ» arrived in ÃÂ«Arrival_City_ÃÂ», ÃÂ«Arrival_StateÃÂ» at ÃÂ«Arrival_Airport_ÃÂ» on ÃÂ«Arrival_DateÃÂ». \n\n\n\nÃÂ«Client_First_NameÃÂ» is entitled to asylum because of the well-founded fear that ÃÂ«PronounÃÂ» will be threatened and harmed because of ÃÂ«PronounÃÂ» sexual orientation \n\n\n\nÃÂ«Client_First_NameÃÂ» has a well-founded fear of persecution in the future \n\n\n\n				An asylum applicant may make an independent showing of well-founded fear of future persecution without regard to past persecution. Mihaylov v. Ashcroft, 379 F.3d 15, 21 (1st Cir. 2004). The test requires a showing that there is a Ã¢â¬Åreasonable possibilityÃ¢â¬Â of persecution on account of a protected ground if returned. 8 C.F.R. ÃÂ§ 1208.13(b)(2)(i); see also Sugiarto v. Holder, 586 F.3d 90, 96-97 (1st Cir. 2009) (citing INS v. Cardoza-Fonseca, 480 U.S. 421, 440 (1987)). The First Circuit in Sugiarto expanded upon the Ã¢â¬Åreasonable possibilityÃ¢â¬Â standard, noting that: \n\n		[A]n applicant need not provide evidence of a Ã¢â¬Ëreasonable possibilityÃ¢â¬â¢ of being Ã¢â¬Ësingled out individually for persecutionÃ¢â¬â¢ in the event that the applicant establishes Ã¢â¬Ëa pattern or practiceÃ¢â¬â¢ in her country of persecution of Ã¢â¬Ëa group of persons similarly situated to the applicantÃ¢â¬â¢ on account of a protected ground.\n\n		\n\n		Sugiarto v. Holder, at 97.\n\n					According to the Supreme Court, a showing of Ã¢â¬Åreasonable possibilityÃ¢â¬Â falls below the preponderance by the evidence standard and can be as low as a one in ten chance of future persecution. INS v. Cardoza-Fonseca, at 440. \n\n					The well-founded fear standard requires both subjective and objective findings. Id.; see also Matter of Acosta, 18 I&N Dec. 211, 224 (BIA 1985) (overruled on other grounds by Matter of Mogharrabi, 19 I&N Dec. 439 (BIA 1987)); see also Aguilar-Solis v. INS, 168 F.3d 565, 572 (1st Cir. 1999). The subjective component is satisfied when the applicant demonstrates a genuine fear of return. Alvarez-Flores v. INS, 909 F.2d 1, 5 (1st Cir. 1990). The objective finding requires Ã¢â¬Åthat the applicant show Ã¢â¬Ëby credible, direct, and specific evidence . . . facts that would support a reasonable fear that the petitioner faces persecution.Ã¢â¬â¢Ã¢â¬Â Id. (citing Diaz-Escobar v. INS, 782 F.2d 1488, 1492 (9th Cir. 1986)).\n\n						In this case, ÃÂ«Client_First_NameÃÂ» both subjectively and objectively has a reason to fear  return to Brazil. \n\nFear of future persecution for ÃÂ«Client_First_NameÃÂ» is objectively reasonable  \n\n\n\nÃÂ«Client_First_NameÃÂ»Ã¢â¬â¢s fear of persecution is reasonable because of the increasingly targeted violence against LGBTQIA individuals in ÃÂ«Home_CountryÃÂ».\n\n\n\nÃÂ«Client_First_NameÃÂ» has a subjective fear of future persecution \n\n\n\nThe subjective element of the well-founded fear standard is met if the applicantÃ¢â¬â¢s fears are genuine. See Alvarez-Flores 909 F.2d at 5. Fear is a Ã¢â¬Åsubjective condition, an emotion characterized by the anticipation or awareness of danger.Ã¢â¬Â See Matter of Acosta, 18 I&N Dec. at 221 (citing WebsterÃ¢â¬â¢s Third New International Dictionary 831 (16th ed. 1971).  \n\nÃÂ«Client_First_NameÃÂ» fear of persecution is country wide \n\n\n\nA fear of persecution is country wide if the threats and violence the applicant faces persists throughout the country. See Kaiser v. Ashcroft, 390 F.3d 653, 660 (9th Cir. 2004) (receiving death threats over phone from two different cities 400 miles apart in Pakistan found to be country wide persecution.)   \n\n\n\nÃÂ«Client_First_NameÃÂ» is a member of a cognizable particular social group defined by ÃÂ«PronounÃÂ» sexual orientation\n\n\n\n				An asylum applicant must demonstrate that the persecution alleged was inflicted or would be inflicted on account of race, religion, nationality, membership in a particular social group, or political opinion. See INA ÃÂ§ 101(a)(42)(A). The BIA has adopted a three-part test that must be met in order for a proposed particular social group to be cognizable. The social group must be (1) composed of individuals who share a common immutable characteristic, (2) socially distinct within the society in question, and (3) defined with sufficient particularity. See Matter of Acosta, 19 I&N Dec. 211, 233-34 (BIA 1985); Matter of M-E-V-G-, 26 I&N Dec. 227, 237 (BIA 2014); Matter of W-G-R-, 26 I&N Dec. 208, 212 (BIA 2014). \n\n					Having an LGBT identity has been found to be a social group by many courts. See Matter of Toboso-Alfonso, 20 I&N Dec. 819, 822-23 (BIA 1990) (holding that a Cuban gay asylum applicant had established membership in a particular social group defined by the status of being a homosexual); Kadri v. Mukasey, 543 F.3d 16 (1st. Circ. 2008). Here, ÃÂ«Client_First_NameÃÂ»Ã¢â¬â¢s proposed social group of Ã¢â¬ÅÃÂ«Particular_Social_GroupÃÂ»Ã¢â¬Â possesses all characteristics required by the BIAÃ¢â¬â¢s test. Through the extensive supporting evidence, ÃÂ«Client_First_NameÃÂ» has established that the particular social group is recognized by courts as an established particular social group and ÃÂ«PronounÃÂ» is a member of it.\n\nÃÂ«Client_First_NameÃÂ»Ã¢â¬â¢s particular social group is defined by immutable characteristics \n\n\n\n       Ã¢â¬ËMembership in a particular social groupÃ¢â¬â¢ refers to persons who hold a Ã¢â¬Ëcommon, immutable characteristicÃ¢â¬â¢ . . . that the group either cannot change, or should not be required to change because it is fundamental to their individual identities or consciences.Ã¢â¬Â Matter of Acosta, 19 I&N Dec. 211, 233-34 (BIA 1985) (finding that membership in a taxi collective did not constitute membership in a particular social group because applicant was free to quit the group). \n\nÃÂ«Client_First_NameÃÂ»Ã¢â¬â¢s particular social group is socially distinct \n\n\n\n					Social distinction, for purposes of particular social group, requires that Ã¢â¬Åthere must be evidence showing that society in general perceives, considers, or recognizes persons sharing the particular characteristic to be a group.Ã¢â¬Â Matter of W-G-R-, 26 I&N Dec. 208, 217 (BIA 2014); Matter of M-E-V-G-, 26 I&N Dec. 227, 238 (BIA 2014) (Ã¢â¬Åthe Ã¢â¬Ësocial distinctionÃ¢â¬â¢ requirement considers whether those with a common immutable characteristic are set apart, or distinct, from other persons within the society in some significant wayÃ¢â¬Â); Matter of C-A-, 23 I&N Dec. 951, 956-7 (BIA 2006) (Ã¢â¬ÅTo be socially distinct, a group need not be seen by society; rather, it must be perceived as a group by societyÃ¢â¬Â).\n\nÃÂ«Client_First_NameÃÂ» particular social group is defined with the requisite particularity \n\n\n\n       Particularity requires that the particular social group Ã¢â¬Åbe defined by characteristics that provide a clear benchmark for determining who falls within the group.Ã¢â¬Â Matter of W-G-R-, 26 I&N Dec. 208, 214 (BIA 2014). The particular social group must Ã¢â¬Åbe discrete with definable boundariesÃ¢â¬âit must not be amorphous, overbroad, diffuse, or subjective.Ã¢â¬Â Id. The terms used to describe the group must have commonly accepted definitions in the relevant society. Id. Ã¢â¬ÅCircuit courts have long recognized that a social group must have Ã¢â¬Ëdefined boundariesÃ¢â¬â¢ or a Ã¢â¬Ëlimiting characteristic,Ã¢â¬â¢ other than the risk of being persecuted, in order to be recognized.Ã¢â¬Â Id. at 215. (citing Sanchez-Trujillo v. INS, 801 F.2d at 1576-77 (9th Cir. 1986)); Castellano-Chacon v. INS, 341 F.3d at 548 (6th Cir. 2003).\n\n					In Matter of M-E-V-G-, the BIA explained that the particularity requirement is Ã¢â¬Ådefinitional in natureÃ¢â¬Â and is used to determine the Ã¢â¬Åouter limits of a groupÃ¢â¬â¢s boundaries.Ã¢â¬Â  Matter of M-E-V-G-, 26 I&N Dec. at 241 (recognizing sexual orientation as falling into all three requirements of a particular social group); see also Matter of W-G-R- 26 I&N Dec. at 214 (requiring particular social groups be limited by parameters a society would recognize).\n\n					Here, the particular social group is based on sexual orientation and the BIA has found that it has the requisite particularity. See Matter of M-E-V-G-, 26 I&N Dec. at 245 (describing a prior BIA decision, Matter of Taboso Alfonso, articulating that homosexuals in Cuba is a particular social group) . [Particular Social Group] is identical to the particular social group cited to in Matter ov M-E-V-G- with the only difference being the country. Id. Therefore, Ã¢â¬ÅÃÂ«Particular_Social_GroupÃÂ»Ã¢â¬Â is a group with well-defined boundaries.   \n\nÃÂ«Client_First_NameÃÂ»Ã¢â¬â¢s abusers persecuted ÃÂ«PronounÃÂ» Ã¢â¬Åon account ofÃ¢â¬Â ÃÂ«PronounÃÂ» membership in a particular social group \n\n			\n\nAnother element of asylum is the nexus linking the protected ground and persecution. 8 U.S.C. ÃÂ§ 1101(a)(42)(A); INA ÃÂ§ 101(a)(42)(A). The Supreme Court has provided a basic standard for determining when persecution is Ã¢â¬ÅÃ¢â¬Ëon account ofÃ¢â¬â¢ an asserted ground.Ã¢â¬Â INS v. Elias-Zacarias, 502 U.S. 478, 482 (1992). In INS v. Elias-Zacarias, the Supreme Court required that the applicant provide some evidence, direct or circumstantial, demonstrating that the underlying motivation to persecute the victim stems from a protected ground enumerated in the refugee definition. 502 U.S. 478, 483 (1992). The exact motivation of the persecutor need not be established; however, the asylum applicant does bear the burden of establishing facts on which Ã¢â¬Åa reasonable person would fear that the danger arises on account of [a protected ground].Ã¢â¬Â Matter of Fuentes, 19 I&N Dec. 658, 662 (BIA 1988). In mixed motive cases, the protected ground must be Ã¢â¬ÅÃ¢â¬Ëone central reasonÃ¢â¬â¢ for the mistreatment.Ã¢â¬Â REAL ID Act ÃÂ§ 101(a)(3); 8 U.S.C. ÃÂ§ 1158(b)(1)(B)(i); Singh v. Mukasey, 543 F.3d 1, 5 (1st Cir. 2008) (quoting In re J-B-N, 24 I&N Dec. 208, 214 (BIA 2007)). In other words, the protected ground cannot be Ã¢â¬ÅÃ¢â¬Ëincidental, tangential, superficial, or subordinateÃ¢â¬â¢Ã¢â¬Â to another reason for the persecution. In re J-B-N, 24 I&N Dec. at 213.\n\nDirect evidence of nexus includes statements or actions by the persecutor that suggests persecution on account of a protected ground. See USCIS Gender Guidelines, at 26 (Ã¢â¬ÅFor example, in a domestic violence claim, an adjudicator would consider evidence that the abuser uses violence to enforce power and control over the applicant because of the social status that a woman may acquire when she is in a domestic relationship. This would include any direct evidence about the abuser\'s own actionsÃ¢â¬Â). In addition, the socio-cultural, legal, and political context in which the persecution occurs should be taken into account when inquiring about motive. Id.; Matter of S-P-, 21 I&N Dec. 486, 495-96 (B.I.A. 1996).\n\n\n\nThe ÃÂ«Home_CountryÃÂ» government is unable and unwilling to protect ÃÂ«Client_First_NameÃÂ»\n\n\n\nWhere the persecutor is a private actor, rather than the government itself, an applicant for asylum must demonstrate that the government was either unwilling or unable to protect her from her persecutor. Rosales Justo v. Sessions, 895 F.3d 154, 162 (1st Cir. 2018). Proper analysis of the Ã¢â¬Åunwilling or unableÃ¢â¬Â element of asylum considers an applicantÃ¢â¬â¢s access to meaningful and effective state protection in light of the record as a whole. Id. at 165-66. Failure to report private abuse to the government is not fatal to an applicantÃ¢â¬â¢s claim if the applicant can demonstrate that doing so would have been futile. Id. at 165; Morales-Morales v. Sessions, 857 F.3d 130, 135 (1st Cir. 2017); Matter of S-A-, 22 I&N Dec. 1328 (BIA 2000) (finding applicant had established a state action where country conditions evidence showed that applying to the police would have been futile and dangerous and that legal remedies were generally unavailable to women).\n\nÃÂ«Client_First_NameÃÂ» merits a favorable exercise of discretion \n\n\n\nIn order to determine whether an applicant for asylum merits a discretionary grant of asylum, the adjudicator should consider the totality of circumstances, weighing both favorable and adverse factors. See Matter of Pula, 19 I&N Dec. 467, 473-74 (BIA 1987) (superseded in part by statute on other grounds as stated inÃÂ Andriasian v. I.N.S.,ÃÂ 180 F.3d 1033, 1043Ã¢â¬â44 & n. 17 (9th Cir.1999)) (Ã¢â¬ÅThe danger of pers