meÂ»âs Application for Asylum \n\n\n\n\n\nDear Sir or Madam: \n\n	I am writing to request that Â«Client_First_NameÂ» Â«Client_Last_NameÂ» be granted asylum because of the persecution Â«PronounÂ» has suffered in Â«PronounÂ» home country of Â«Home_CountryÂ». Â«Client_First_NameÂ» is entitled to a favorable grant of asylum in the United States based on Â«PronounÂ» well-founded fear of future persecution due to Â«PronounÂ» sexual orientation. Because Â«Client_First_NameÂ» was Â«Sexual_OrientationÂ», Â«PronounÂ» suffered verbal abuse, harassment, and threats at the hands of Â«PronounÂ» persecutors. \n\nI.     ARGUMENT  \n\n\n\nÂ«Client_First_NameÂ» meets the statutory definition of refugee \n\n\n\n  An individual who meets the definition of a refugee under section 101(a)(42)(A) of the Immigration and Nationality Act (âINAâ) and complies with the procedural requirements may be eligible for asylum. 8 U.S.C. Â§ 1158(b)(1)(A)(2002); INA Â§ 208(b)(1)(A). The applicant bears the burden of establishing that [Pronoun] qualifies as a refugee. 8 U.S.C. Â§ 1158(b)(1)(B)(i); INA Â§ 208(b)(1)(B)(i). The statutory burden may be met by either (1) demonstrating past persecution on account of a protected ground and thus, creating a presumption of a well-founded fear of persecution, or (2) demonstrating a well-founded fear of persecution on account of a protected ground. 8 C.F.R. Â§ 1208.13(b)). A protected ground must be at least one central reason motivating the persecution. 8 U.S.C. Â§ 1158(b)(1)(A); INA Â§ 208(b)(1)(A).\n\nIn this case, Â«Client_First_NameÂ» meets the definition of a refugee required for asylum. First, Â«Client_First_NameÂ» has a well-founded fear of persecution in Â«Home_CountryÂ» on account of Â«PronounÂ» membership in a particular social group of Â«Particular_Social_GroupÂ». Â«Client_First_NameÂ»âs membership in this particular social group is the central reason for Â«PronounÂ» fear of future persecution and the Â«Home_CountryÂ» government is unable to protect Â«PronounÂ» from being persecuted or killed on account of being Â«Sexual_OrientationÂ».\n\n Â«Client_First_NameÂ» timely filed Â«PronounÂ» application for asylum \n\nIn addition to substantive eligibility, an asylum applicant must show by clear and convincing evidence that Â«PronounÂ» timely filed Â«PronounÂ» asylum application within one year of Â«PronounÂ» last arrival in the United States 8 U.S.C. Â§ 1158(a)(2)(B); INA Â§ 208(a)(2)(B). Here, Â«Client_First_NameÂ» arrived in Â«Arrival_City_Â», Â«Arrival_StateÂ» at Â«Arrival_Airport_Â» on Â«Arrival_DateÂ». \n\n\n\nÂ«Client_First_NameÂ» is entitled to asylum because of the well-founded fear that Â«PronounÂ» will be threatened and harmed because of Â«PronounÂ» sexual orientation \n\n\n\nÂ«Client_First_NameÂ» has a well-founded fear of persecution in the future \n\n\n\n				An asylum applicant may make an independent showing of well-founded fear of future persecution without regard to past persecution. Mihaylov v. Ashcroft, 379 F.3d 15, 21 (1st Cir. 2004). The test requires a showing that there is a âreasonable possibilityâ of persecution on account of a protected ground if returned. 8 C.F.R. Â§ 1208.13(b)(2)(i); see also Sugiarto v. Holder, 586 F.3d 90, 96-97 (1st Cir. 2009) (citing INS v. Cardoza-Fonseca, 480 U.S. 421, 440 (1987)). The First Circuit in Sugiarto expanded upon the âreasonable possibilityâ standard, noting that: \n\n		[A]n applicant need not provide evidence of a âreasonable possibilityâ of being âsingled out individually for persecutionâ in the event that the applicant establishes âa pattern or practiceâ in her country of persecution of âa group of persons similarly situated to the applicantâ on account of a protected ground.\n\n		\n\n		Sugiarto v. Holder, at 97.\n\n					According to the Supreme Court, a showing of âreasonable possibilityâ falls below the preponderance by the evidence standard and can be as low as a one in ten chance of future persecution. INS v. Cardoza-Fonseca, at 440. \n\n					The well-founded fear standard requires both subjective and objective findings. Id.; see also Matter of Acosta, 18 I&N Dec. 211, 224 (BIA 1985) (overruled on other grounds by Matter of Mogharrabi, 19 I&N Dec. 439 (BIA 1987)); see also Aguilar-Solis v. INS, 168 F.3d 565, 572 (1st Cir. 1999). The subjective component is satisfied when the applicant demonstrates a genuine fear of return. Alvarez-Flores v. INS, 909 F.2d 1, 5 (1st Cir. 1990). The objective finding requires âthat the applicant show âby credible, direct, and specific evidence . . . facts that would support a reasonable fear that the petitioner faces persecution.ââ Id. (citing Diaz-Escobar v. INS, 782 F.2d 1488, 1492 (9th Cir. 1986)).\n\n						In this case, Â«Client_First_NameÂ» both subjectively and objectively has a reason to fear  return to Brazil. \n\nFear of future persecution for Â«Client_First_NameÂ» is objectively reasonable  \n\n\n\nÂ«Client_First_NameÂ»âs fear of persecution is reasonable because of the increasingly targeted violence against LGBTQIA individuals in Â«Home_CountryÂ».\n\n\n\nÂ«Client_First_NameÂ» has a subjective fear of future persecution \n\n\n\nThe subjective element of the well-founded fear standard is met if the applicantâs fears are genuine. See Alvarez-Flores 909 F.2d at 5. Fear is a âsubjective condition, an emotion characterized by the anticipation or awareness of danger.â See Matter of Acosta, 18 I&N Dec. at 221 (citing Websterâs Third New International Dictionary 831 (16th ed. 1971).  \n\nÂ«Client_First_NameÂ» fear of persecution is country wide \n\n\n\nA fear of persecution is country wide if the threats and violence the applicant faces persists throughout the country. See Kaiser v. Ashcroft, 390 F.3d 653, 660 (9th Cir. 2004) (receiving death threats over phone from two different cities 400 miles apart in Pakistan found to be country wide persecution.)   \n\n\n\nÂ«Client_First_NameÂ» is a member of a cognizable particular social group defined by Â«PronounÂ» sexual orientation\n\n\n\n				An asylum applicant must demonstrate that the persecution alleged was inflicted or would be inflicted on account of race, religion, nationality, membership in a particular social group, or political opinion. See INA Â§ 101(a)(42)(A). The BIA has adopted a three-part test that must be met in order for a proposed particular social group to be cognizable. The social group must be (1) composed of individuals who share a common immutable characteristic, (2) socially distinct within the society in question, and (3) defined with sufficient particularity. See Matter of Acosta, 19 I&N Dec. 211, 233-34 (BIA 1985); Matter of M-E-V-G-, 26 I&N Dec. 227, 237 (BIA 2014); Matter of W-G-R-, 26 I&N Dec. 208, 212 (BIA 2014). \n\n					Having an LGBT identity has been found to be a social group by many courts. See Matter of Toboso-Alfonso, 20 I&N Dec. 819, 822-23 (BIA 1990) (holding that a Cuban gay asylum applicant had established membership in a particular social group defined by the status of being a homosexual); Kadri v. Mukasey, 543 F.3d 16 (1st. Circ. 2008). Here, Â«Client_First_NameÂ»âs proposed social group of âÂ«Particular_Social_GroupÂ»â possesses all characteristics required by the BIAâs test. Through the extensive supporting evidence, Â«Client_First_NameÂ» has established that the particular social group is recognized by courts as an established particular social group and Â«PronounÂ» is a member of it.\n\nÂ«Client_First_NameÂ»âs particular social group is defined by immutable characteristics \n\n\n\n       âMembership in a particular social groupâ refers to persons who hold a âcommon, immutable characteristicâ . . . that the group either cannot change, or should not be required to change because it is fundamental to their individual identities or consciences.â Matter of Acosta, 19 I&N Dec. 211, 233-34 (BIA 1985) (finding that membership in a taxi collective did not constitute membership in a particular social group because applicant was free to quit the group). \n\nÂ«Client_First_NameÂ»âs particular social group is socially distinct \n\n\n\n					Social distinction, for purposes of particular social group, requires that âthere must be evidence showing that society in general perceives, considers, or recognizes persons sharing the particular characteristic to be a group.â Matter of W-G-R-, 26 I&N Dec. 208, 217 (BIA 2014); Matter of M-E-V-G-, 26 I&N Dec. 227, 238 (BIA 2014) (âthe âsocial distinctionâ requirement considers whether those with a common immutable characteristic are set apart, or distinct, from other persons within the society in some significant wayâ); Matter of C-A-, 23 I&N Dec. 951, 956-7 (BIA 2006) (âTo be socially distinct, a group need not be seen by society; rather, it must be perceived as a group by societyâ).\n\nÂ«Client_First_NameÂ» particular social group is defined with the requisite particularity \n\n\n\n       Particularity requires that the particular social group âbe defined by characteristics that provide a clear benchmark for determining who falls within the group.â Matter of W-G-R-, 26 I&N Dec. 208, 214 (BIA 2014). The particular social group must âbe discrete with definable boundariesâit must not be amorphous, overbroad, diffuse, or subjective.â Id. The terms used to describe the group must have commonly accepted definitions in the relevant society. Id. âCircuit courts have long recognized that a social group must have âdefined boundariesâ or a âlimiting characteristic,â other than the risk of being persecuted, in order to be recognized.â Id. at 215. (citing Sanchez-Trujillo v. INS, 801 F.2d at 1576-77 (9th Cir. 1986)); Castellano-Chacon v. INS, 341 F.3d at 548 (6th Cir. 2003).\n\n					In Matter of M-E-V-G-, the BIA explained that the particularity requirement is âdefinitional in natureâ and is used to determine the âouter limits of a groupâs boundaries.â  Matter of M-E-V-G-, 26 I&N Dec. at 241 (recognizing sexual orientation as falling into all three requirements of a particular social group); see also Matter of W-G-R- 26 I&N Dec. at 214 (requiring particular social groups be limited by parameters a society would recognize).\n\n					Here, the particular social group is based on sexual orientation and the BIA has found that it has the requisite particularity. See Matter of M-E-V-G-, 26 I&N Dec. at 245 (describing a prior BIA decision, Matter of Taboso Alfonso, articulating that homosexuals in Cuba is a particular social group) . [Particular Social Group] is identical to the particular social group cited to in Matter ov M-E-V-G- with the only difference being the country. Id. Therefore, âÂ«Particular_Social_GroupÂ»â is a group with well-defined boundaries.   \n\nÂ«Client_First_NameÂ»âs abusers persecuted Â«PronounÂ» âon account ofâ Â«PronounÂ» membership in a particular social group \n\n			\n\nAnother element of asylum is the nexus linking the protected ground and persecution. 8 U.S.C. Â§ 1101(a)(42)(A); INA Â§ 101(a)(42)(A). The Supreme Court has provided a basic standard for determining when persecution is ââon account ofâ an asserted ground.â INS v. Elias-Zacarias, 502 U.S. 478, 482 (1992). In INS v. Elias-Zacarias, the Supreme Court required that the applicant provide some evidence, direct or circumstantial, demonstrating that the underlying motivation to persecute the victim stems from a protected ground enumerated in the refugee definition. 502 U.S. 478, 483 (1992). The exact motivation of the persecutor need not be established; however, the asylum applicant does bear the burden of establishing facts on which âa reasonable person would fear that the danger arises on account of [a protected ground].â Matter of Fuentes, 19 I&N Dec. 658, 662 (BIA 1988). In mixed motive cases, the protected ground must be ââone central reasonâ for the mistreatment.â REAL ID Act Â§ 101(a)(3); 8 U.S.C. Â§ 1158(b)(1)(B)(i); Singh v. Mukasey, 543 F.3d 1, 5 (1st Cir. 2008) (quoting In re J-B-N, 24 I&N Dec. 208, 214 (BIA 2007)). In other words, the protected ground cannot be ââincidental, tangential, superficial, or subordinateââ to another reason for the persecution. In re J-B-N, 24 I&N Dec. at 213.\n\nDirect evidence of nexus includes statements or actions by the persecutor that suggests persecution on account of a protected ground. See USCIS Gender Guidelines, at 26 (âFor example, in a domestic violence claim, an adjudicator would consider evidence that the abuser uses violence to enforce power and control over the applicant because of the social status that a woman may acquire when she is in a domestic relationship. This would include any direct evidence about the abuser\'s own actionsâ). In addition, the socio-cultural, legal, and political context in which the persecution occurs should be taken into account when inquiring about motive. Id.; Matter of S-P-, 21 I&N Dec. 486, 495-96 (B.I.A. 1996).\n\n\n\nThe Â«Home_CountryÂ» government is unable and unwilling to protect Â«Client_First_NameÂ»\n\n\n\nWhere the persecutor is a private actor, rather than the government itself, an applicant for asylum must demonstrate that the government was either unwilling or unable to protect her from her persecutor. Rosales Justo v. Sessions, 895 F.3d 154, 162 (1st Cir. 2018). Proper analysis of the âunwilling or unableâ element of asylum considers an applicantâs access to meaningful and effective state protection in light of the record as a whole. Id. at 165-66. Failure to report private abuse to the government is not fatal to an applicantâs claim if the applicant can demonstrate that doing so would have been futile. Id. at 165; Morales-Morales v. Sessions, 857 F.3d 130, 135 (1st Cir. 2017); Matter of S-A-, 22 I&N Dec. 1328 (BIA 2000) (finding applicant had established a state action where country conditions evidence showed that applying to the police would have been futile and dangerous and that legal remedies were generally unavailable to women).\n\nÂ«Client_First_NameÂ» merits a favorable exercise of discretion \n\n\n\nIn order to determine whether an applicant for asylum merits a discretionary grant of asylum, the adjudicator should consider the totality of circumstances, weighing both favorable and adverse factors. See Matter of Pula, 19 I&N Dec. 467, 473-74 (BIA 1987) (superseded in part by statute on other grounds as stated inÂ Andriasian v. I.N.S.,Â 180 F.3d 1033, 1043â44 & n. 17 (9th Cir.1999)) (âThe danger of persecution will outweigh all but the most egregious adverse factorsâ). Factors to consider include: circumstances surrounding the applicantâs flight from her country of origin and general humanitarian considerations such as age, health, and family ties. Id. \n\n CONCLUSION \n\n	For the foregoing reasons, Â«Client_First_NameÂ» has established statutory eligibility for asylum. \n\nRepectfully submitted, \n\nÂ«Client_First_NameÂ» Â«Client_Last_NameÂ»\n\nBy Â«PronounÂ» attorneys, \n\n\n\n\n\n\n\n\n\n___________________________\n\nÂ«Attorney_OneÂ»\n\n\n\n\n\n\n\n____________________________\n\nÂ«Attorney_Two_Â»\n\n\n\n\n\nDATED: Â«DATE_Â»\n\n\n\n\n9');
